    color: '#387968',
    position: 'col-6'
  },
  {
    number: 8,
    color: '#6558f5',
    position: 'col-6'
  },
  {
    number: 9,
    color: '#4b5c6b',
    position: 'col-6'
  }
]

function App() {
  return (
    <div className="App">
      <div className="container">
        <div className="row">
          { blockRand.map((b) => {
            return (
              <div className={cob.position} style={{background: b.color}}>
                {b.number}
              </div>
            )
          })}
        </div>
      </div>
    </div>
  );
}

export default App;
